import React from "react";

const Home = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-6">
          <h1></h1>
          <h5>FullStack Developer</h5>
          <button>Más Información</button>
        </div>
        <div className="col-md-6"></div>
      </div>
    </div>
  );
};

export default Home;
